INSERT INTO `chapters` VALUES ('Phương pháp giảng dạy Kỹ năng Giải quyết vấn đề',27,'',NULL,'2022-11-28 17:13:21','2023-03-02 15:22:35',51),('Kỹ năng Giải quyết vấn đề',3,'',NULL,'2022-11-28 17:14:57','2022-11-28 17:14:57',52),('Các kỹ thuật giảng dạy',3,'Mục tiêu: Sau khi hoàn thành chuyên đề này, người tham dự sẽ có thể được trang bị các kỹ năng thiết kế kết quả học tập, xây dựng câu hỏi theo các cấp độ tư duy của Bloom, trải nghiệm các hoạt động giảng dạy lấy người học làm trung tâm, đánh giá lớp học, soạn giáo án và thực hiện bài giảng theo mô hình BOPPPS và CoARDs. Đặc biệt được cấp giấy chứng nhận của mạng lưới ISW Canada (iswnetwork.ca).',NULL,'2023-02-02 10:21:56','2023-02-02 10:21:56',53),('Kỹ thuật thiết kế các bài tập đánh giá trên hệ thống LMS ',4,'Bài tập trắc nghiệm là một công cụ quen thuộc để đánh giá sinh viên. Với sự hỗ trợ của LMS bài tập trắc nghiệm ngoài sự đa dạng câu hỏi như câu hỏi nhiều lựa chọn, đúng sai, điền khuyết… mà nó còn có hình thức trình bày phong phú (hình ảnh, video, công thức) … Ngoài ra bài tập trắc nghiệm còn giúp thầy cô tiết kiệm thời gian chấm điểm bài làm hay biên soạn câu hỏi bằng cách phối hợp biên soạn (nhiều giảng viên soạn chung một bộ câu hỏi và chia sẻ với nhau).\r\n\r\nSau đợt tập huấn này, thầy cô có thể:\r\n+ Thêm câu hỏi trắc nghiệm vào ngân hàng câu hỏi LMS theo cách thủ công.\r\n+ Nhập hàng loạt câu hỏi nhiều lựa chọn vào ngân hàng câu hỏi LMS.\r\n+ Tạo bài tập trắc nghiệm trên LMS.\r\n+ Xuất điểm bài tập trắc nghiệm về file Excel.',1,'2022-05-18 10:06:30','2022-05-18 10:06:30',2),('Phương pháp giảng dạy trực tuyến',3,'',1,NULL,'2022-07-20 07:28:13',3),('Xây dựng Ngân hàng câu hỏi theo hình thức trắc nghiệm',26,'',1,NULL,'2022-07-20 07:29:10',4),('Xây dựng Chuẩn đầu ra và xác định trình độ năng lực của chuẩn đầu ra',5,'',1,NULL,'2022-07-20 07:29:18',5),('Xây dựng Ma trận và Đề cương chi tiết học phần',5,'',1,NULL,'2022-07-20 07:29:25',6),('Các chiến thuật giảng dạy online',3,'',1,NULL,'2022-07-20 07:29:29',7),('Tạo hoạt động tương tác cho bài giảng PowerPoint với ClassPoint',26,NULL,1,NULL,NULL,8),('Xây dựng video học liệu',4,'',1,'2022-07-22 07:48:10','2022-07-22 07:48:10',9),('Tập huấn các kỹ năng giảng dạy (ISW: Instructional Skills Workshop)',3,'Mục tiêu: Sau khi hoàn thành chuyên đề này, người tham dự sẽ có thể được trang bị các kỹ năng thiết kế kết quả học tập, xây dựng câu hỏi theo các cấp độ tư duy của Bloom, trải nghiệm các hoạt động giảng dạy lấy người học làm trung tâm, đánh giá lớp học, soạn giáo án và thực hiện bài giảng theo mô hình BOPPPS và CoARDs. Đặc biệt được cấp giấy chứng nhận của mạng lưới ISW Canada (iswnetwork.ca).',1,NULL,'2023-02-03 09:13:25',26),('Phương pháp dạy học dựa trên tra cứu',3,'Sau khi hoàn thành chuyên đề này, người tham dự sẽ có thể:\r\n + Trình quy trình thực hiện việc học tập dựa trên tra cứu (IBL).\r\n + Nhận dạng các phương pháp/hoạt động phù hợp với IBL.\r\n + Xác định các mức độ của KQHT và cách đánh giá phù hợp với IBL.\r\n + Vận dụng phương pháp dạy học dựa trên tra trong lập kế hoạch môn học và bài giảng.\r\n',NULL,'2022-11-28 15:43:02','2022-11-28 15:43:02',50),('Kỹ năng Đàm phán',3,NULL,1,NULL,NULL,28),('Kỹ năng Giao tiếp',3,NULL,1,NULL,NULL,29),('Kỹ năng Kiểm soát sự căng thẳng',3,NULL,1,NULL,NULL,30),('Kỹ năng Làm việc nhóm',27,'',1,NULL,'2023-03-02 14:41:20',31),('Kỹ năng Quản lý tài chính cá nhân',3,NULL,1,NULL,NULL,32),('Kỹ năng Tìm kiếm tài liệu, đọc hiểu và ghi nhớ tài liệu',3,NULL,1,NULL,NULL,33),('Kỹ năng Tư duy phản biện',3,NULL,1,NULL,NULL,34),('Kỹ năng Tư duy sáng tạo',3,NULL,1,NULL,NULL,35),('Kỹ năng xây dựng và sử dụng câu hỏi',3,NULL,1,NULL,NULL,36),('Kỹ thuật dạy học có tương tác',3,NULL,1,NULL,NULL,37),('Kỹ thuật xây dựng ngân hàng câu hỏi trắc nghiệm',3,NULL,1,NULL,NULL,38),('Phương pháp dạy học dựa trên dự án',3,NULL,1,NULL,NULL,39),('Tập huấn Phát triển Điều phối viên (FDW)',3,NULL,1,NULL,NULL,40),('Thực hành xây dựng video học liệu',4,NULL,1,NULL,NULL,41),('Xây dựng bài kiểm tra thực hành 