29,'Buổi 1: Open Educational resources for teaching and learning (OER) \r\n1. Lợi ích của OER\r\n2. Giấy phép OER\r\n3. Cách tìm kiếm, đánh giá và sử dụng OER cho dạy và học\r\n4. Kinh nghiệm của RMIT trong việc sử dụng OER\r\n5. Luyện tập\r\nBuổi 2: Open access resources for research \r\n1. Tìm kiếm nâng cao với Google Scholar\r\n2. Tạo Hồ sơ học thuật: Google Scholar, ORCID\r\n3. Tra cứu giáo trình miễn phí\r\n4. Tìm kiếm các nguồn xuất bản khác nhau \r\n5. Luyện tập',1,'2023-05-31 14:11:31','2023-05-31 14:12:29',80);
