INSERT INTO `muc_do_nhan_thucs` VALUES (1,'Nhớ','Remember','Có thể nhắc lại các thông tin đã tiếp nhận trước đó',1,'2023-01-01 12:02:23','2023-01-04 20:22:46',1),(2,'Hiểu','Understand','Nắm được ý nghĩa của thông tin; thể hiện qua diễn giải, suy diễn, liên hệ, khái quát',1,'2023-01-01 12:03:16','2023-01-04 20:23:39',2),(3,'Áp dụng','Apply','Áp dụng thông tin đã biết vào tình huống, điều kiện, ngữ cảnh mới',1,'2023-01-01 12:05:37','2023-01-04 20:26:31',3),(4,'Phân tích','Analyze','Sử dụng bằng chứng và lập luận để phân tích vấn đề',1,'2023-01-01 12:06:52','2023-01-04 20:27:20',4),(5,'Đánh giá','Evaluate','Đưa ra nhận định, phán quyết các thông tin dựa trên các chuẩn mực, tiêu chí',1,'2023-01-01 12:07:10','2023-01-04 20:28:26',5),(6,'Sáng tạo','Create','Tổng hợp các kiến thức để tạo nên các vấn đề mới',1,'2023-01-01 12:07:28','2023-01-04 20:29:30',6),(1,'Bắt chước','Imitation','Thực hiện các động tác, thao tác theo mẫu',2,'2023-01-01 12:08:05','2023-01-04 20:32:58',7),(2,'Thao tác theo chỉ dẫn','Manipulation','Các kỹ năng ban đầu hình thành trên cơ sở chỉ dẫn những kiến thức, kinh nghiệm. Thực hiện như đã hướng dẫn ',2,'2023-01-01 12:08:31','2023-01-04 20:34:24',8),(3,'Thuần thục','Precision','Hình thành các khả năng, năng lực liên kết, phối hợp kỹ năng trong qui trình thực hiện một công việc hoặc một sản phẩm nhất định. Thực hiện chính xác như đã hướng dẫn.',2,'2023-01-01 12:08:52','2023-01-04 20:35:21',9),(4,'Phối hợp','Articulation','Các hoạt động được phối hợp nhuần nhuyễn với nhau, hình thành kỹ xảo',2,'2023-01-01 12:09:21','2023-01-04 20:36:28',10),(5,'Tự động hoá','Naturalization','Hình thành các kỹ xảo một cách tự nhiên mà không cần phải suy nghĩ nhiều',2,'2023-01-01 12:09:50','2023-01-04 20:37:04',11),(1,'Tiếp thu','Receiving','Sẵn sàng lắng nghe, chú ý',3,'2023-01-01 12:10:28','2023-01-04 20:47:33',12),(2,'Phản hồi','Responding','Bằng lòng, sẵn sàng hoạt động',3,'2023-01-01 12:10:46','2023-01-04 20:47:51',13),(3,'Coi trọng','Valuing','Giá trị một người gắn với một đối tượng cụ thể, hiện tượng hoặc hành vi',3,'2023-01-01 12:11:05','2023-01-04 20:48:12',14),(3,'Tổ chức','Organizing or conceptualizing',' Nhấn mạnh vào việc so sánh, liên hệ và tổng hợp các giá trị',3,'2023-01-01 12:11:38','2023-01-04 20:48:29',15),(5,'Hình thành tính cách','Internalizing values','Có một hệ thống giá trị điều khiển hành vi',3,'2023-01-01 12:12:10','2023-01-04 20:48:50',16);
