INSERT INTO `supporting_requests` VALUES ('Môn học chưa đến thời gian dạy','',NULL,'Môn học này đến tháng 10/2022 mới dạy nên chưa đưa bài tập cho sinh viên. Hiện tại đã cập nhật, bổ sung các nội dung liên quan',1700,2,7832,'Thầy Vui tiếp tục xây dựng bài giảng nhé','2022-07-01 14:39:55',0,'2022-06-20 18:55:36','2022-07-01 14:39:55',39),('Phản hồi về môn học Giao tiếp sư phạm tiểu học ','',NULL,'Môn học này đã chuyển sang gv Nguyễn Văn Sia, bộ môn Tâm lý _ Công tác xã hội khoa Cơ bản',1721,2,7829,'Đã xóa khóa học của cô Yến','2022-06-21 09:14:58',1,'2022-06-20 15:34:48','2022-07-01 13:48:46',38),('Phản hồi về môn học Giao tiếp sư phạm tiểu học ','',NULL,'Môn học này đã chuyển sang gv Nguyễn Văn Sia, bộ môn Tâm lý _ Công tác xã hội khoa Cơ bản',1721,2,7829,'Đã xóa khóa học của cô Yến','2022-06-21 09:15:41',1,'2022-06-20 15:34:46','2022-07-01 13:49:17',37),('Phản hồi về môn học Giao tiếp sư phạm tiểu học ','',NULL,'Môn học này đã chuyển sang gv Nguyễn Văn Sia, bộ môn Tâm lý _ Công tác xã hội khoa Cơ bản',1721,2,7829,'Đã xóa khóa học của cô Yến','2022-06-21 09:16:04',1,'2022-06-20 15:34:42','2022-07-01 13:49:40',36),('Môn chuyên đề về gia súc độc vị','',NULL,'Môn chuyên đề về gia súc độc vị, môn này gồm 3 GV dạy. Mỗi GV tự tạo cho mình 1 khóa học riêng. Em có tạo cho mình khóa học  (22122 - 330282 - Chuyên đề về gia súc độc vị - Nguyễn Thùy Linh ), kết quả Đạt. \r\nXin Trung tâm hỗ trợ xem về trường hợp môn này.\r\nXin cám ơn Trung tâm.\r\nThùy Linh',1673,2,7832,'Nên hủy phần chung và giữ lại khóa học của từng GV ','2022-07-01 11:28:28',1,'2022-06-20 20:05:52','2022-07-04 15:55:53',40),('Lý do: Còn nguyên khoá học mẫu (2/5/2022)','',NULL,'22122 - 330189 - Bệnh truyền nhiễm thú y - Nguyễn Thị Đấu 	2022-06-13 \r\n\r\nMÔN ở thứ tự số 10: có thể bị dư, vì 3 lớp đã đủ 3 môn học phía trên\r\n\r\nYêu cầu ĐƯỢC BỎ thứ tự số 10',1664,2,7832,'GV Đã cập nhật bài giảng','2022-06-29 16:52:22',0,'2022-06-21 07:32:01','2022-06-29 16:52:22',44),('Môn học đã chuyển GV khác','',NULL,'Môn học đã được chuyển cho giảng viên khác ở đầu học kỳ.',1878,2,7830,'','2022-06-21 09:02:03',1,'2022-06-21 07:44:40','2022-07-01 13:50:48',45),('Môn học đã chuyển GV khác','',NULL,'Môn học đã được chuyển cho giảng viên khác ở đầu học kỳ.',1878,2,7838,'','2022-06-28 10:41:22',1,'2022-06-21 07:44:42','2022-07-01 15:49:58',46),('Môn học không có sắp lịch dạy!','',NULL,'Đề nghị kiểm tra lại, môn học này không có sắp lịch dạy (bộ môn đã dời môn học)!',1888,2,7830,'BCT đã xử lý, cảm ơn Quý Thầy/Cô đã phản hồi.','2022-06-21 09:02:29',1,'2022-06-21 07:50:52','2022-07-01 15:50:57',47),('Môn học không có sắp lịch dạy!','',NULL,'Đề nghị kiểm tra lại, môn học này không có sắp lịch dạy (bộ môn đã dời môn học)!',1888,2,7838,'','2022-06-28 10:41:29',1,'2022-06-21 07:50:54','2022-07-01 15:51:17',48),('Khóa học môn \"Hóa Sinh\" ','',NULL,'Do môn học này sv không lựa chọn nên gv không mở lớp. Nhờ TT delete khóa học dùm. Thank you!',1920,2,7832,'Đã hủy kết quả khóa học','2022-06-29 15:48:41',1,'2022-06-21 07:52:11','2022-07-01 15:53:00',49),('Kiểm tra lại (đánh giá khi nào?)','',NULL,'Nhiệm vụ học tập',1880,2,7830,'Kính nhờ Thầy cung cấp link khóa học để BCT xử lý.','2022-06-21 09:41:55',0,'2022-06-21 07:53:22','2022-06-21 09:41:55',50),('Kiểm tra lại (đánh giá khi nào?)','',NULL,'Nhiệm vụ học tập',1880,2,7838,'','2022-06-28 10:41:37',0,'2022-06-21 07:53:25','2022-06-28 10:41:37',51),('Về việc cập nhật khóa học','',NULL,'Chào Ban chuyên trách khóa học,\r\nDo lúc trước nghe nói mỗi Học phần chỉ tạo 1 khóa học cho tất cả các lớp, Nên 5 lớp THUDCB mình dùng chung 1 course trên LMS từ đầu năm đến giờ.\r\nNhờ cán bộ phụ trách kiểm tra lại dùm.\r\nCám ơn!\r\nV.Thanh',1516,2,7830,'BCT đã xử lý, cảm ơn Quý Thầy/Cô đã phản hồi.','2022-06-21 09:04:02',1,'2022-06-21 07:55:13','2022-07-01 15:58:53',52),('Bài tập được giao trực tiếp trên lớp!','',NULL,'Môn học này tôi cho các em làm bài tập trực tiếp trên lớp mỗi buổi học, không có thể hiện trên khóa học. Ngoài ra, nhiệm vụ của các em là xem tài liệu trước và đã thể hiện trong kế hoạch giảng dạy nên không nhắc lại trên khóa học.',1888,2,7830,'BCT đã xử lý, cảm ơn Quý Thầy/Cô đã phản hồi.','2022-06-21 09:05:03',1,'2022-06-21 07:55:15','2022-07-01 15:59:42',53),('Về việc cập nhật khóa học','',NULL,'Chào Ban chuyên trách khóa học,\r\nDo lúc trước nghe nói mỗi Học phần chỉ tạo 1 khóa học cho tất cả các lớp, Nên 5 lớp THUDCB mình dùng chung 1 course trên LMS từ đầu năm đến giờ.\r\nNhờ cán bộ phụ trách kiểm tra lại dùm.\r\nCám ơn!\r\nV.Thanh',1516,2,7838,'','2022-06-21 14:03:26',0,'2022-06-21 07:55:15','2022-07-01 16:00:09',54),('Bài tập được giao trực tiếp trên lớp!','',NULL,'Môn học này tôi cho các em làm bài tập trực tiếp trên lớp mỗi buổi học, không có thể hiện trên khóa học. Ngoài ra, nhiệm vụ của các em là xem tài liệu trước và đã thể hiện trong kế hoạch giảng dạy nên không nhắc lại trên khóa học.',1888,2,7838,'','2022-06-28 10:41:59',1,'2022-06-21 07:55:18','2022-07-02 10:27:11',55),('yêu cầu Trung tâm kiểm tra dùm các môn ở học kỳ I của tôi năm học 2021-2022, hiện tai chưa nhìn thấy. Xin cám ơn.','',NULL,'1. Môn Pháp chế Dược  Mã :  650231\r\n2. Dược Bệnh viện Mã: 650735\r\n3. Kinh tế Dược Mã : 650740\r\n',7883,2,7839,'Dạ em đã xem và đã thấy khóa học được tạo rồi \r\nNhờ cô xem lại a\r\ncảm ơn cô','2022-07-05 08:58:05',0,'2022-06-21 07:59:44','2022-07-05 08:58:05',56),('Chuyên đề truyền thông và mạng không dây','',NULL,'Chưa có lịch dạy khóa học này ',1503,2,7830,'BCT đã xử lý, cảm ơn Quý Thầy/Cô đã phản hồi.','2022-06-21 09:06:29',0,'2022-06-21 08:00:29','2022-07-02 10:26:39',57),('Chuyên đề truyền thông và mạng không dây','',NULL,'Chưa có lịch dạy khóa học này ',1503,2,7838,'','2022-06-28 10:42:09',0,'2022-06-21 08:00:31','2022-07-02 10:26:22',58),('Về khóa học 22122 - 200453 - Dạy học đọc hiểu văn bản trong nhà trường - Bùi Thị Luyến ','',NULL,'Do lớp này (22122 - 200453 - Dạy học đọc hiểu văn bản trong nhà trường - Bùi Thị Luyến) đến 13/8/2022  mới bắt đầu, hiện giảng viên đã gửi đề cương chi tiết đến Bộ môn duyệt, vẫn chưa nhận phản hồi nên chưa thể hoàn thành khóa học e-learning. Vào đầu học kì, giảng viên có nhờ thành viên Bán chuyên trách của Khoa tạm hoãn đánh giá đối với khóa học này. \r\nKhóa học sẽ hoàn chỉnh trước thời điểm bắt đầu giảng dạy chậm nhất 4 tuần (tức 16/7/2022)',1731,2,7833,'ĐẠT','2022-06-29 16:03:31',1,'2022-06-21 08:01:48','2022-07-04 15:58:19',59),('Nhờ hỗ trợ đánh giá khóa học','',NULL,'xin chào BCT E-Learing\r\nMình còn 2 khóa học chưa được đánh giá nên nhờ BCT xem và đánh giá giúp ạ\r\n1. Thiết kế Web cơ bản, kèm link\r\nhttps://lms.tvu.edu.vn/course/view.php?id=3291\r\n2. PT và TK hệ thống thương mại điện tử, kèm link\r\nhttps://lms.tvu.edu.vn/course/view.php?id=3290\r\nXin cảm ơn rất nhiều',7941,2,7830,'BCT đã chuyển Trung tâm TLC, cảm ơn Quý Thầy/Cô đã phản hồi.','2022-06-21 09:08:16',1,'2022-06-21 08:03:33','2022-07-04 15:59:54',60),('Nhờ hỗ trợ đánh giá khóa học','',NULL,'xin chào BCT E-Learing\r\nMình còn 2 khóa học chưa được đánh giá nên nhờ BCT xem và đánh giá giúp ạ\r\n1. Thiết kế Web cơ bản, kèm link\r\nhttps://lms.tvu.edu.vn/course/view.php?id=3291\r\n2. PT và TK hệ thống thương mại điện tử, kèm link\r\nhttps://lms.tvu.edu.vn/course/view.php?id=3290\r\nXin cảm ơn rất nhiều',7941,2,7838,'','2022-06-28 10:42:20',0,'2022-06-21 08:03:35','2022-07-02 10:28:57',61),('Yêu cầu xem xét đánh giá lại khóa học 22122 - 650058 - Xác suất thống kê-Y học - Trần Minh Tâm ','',NULL,'Yêu cầu xem xét đánh giá lại khóa học 22122 - 650058 - Xác suất thống kê-Y học - Trần Minh Tâm \r\nLý do: TKB bắt đầu dạy 30/5/2022 (cập nhật trễ sau ngày 02/5/2022) và  đã cập nhật\r\nXin chân thành cảm ơn',1838,2,7836,'Đạt','2022-06-21 09:54:29',1,'2022-06-21 08:05:10','2022-07-02 10:29:49',62),('Nhờ xem xét lại kết quả đánh giá HP E-learning','',NULL,'Xin chào BCT E-learning,\r\nHiện tại em nhân được kết quả đánh giá \"KHÔNG ĐẠT\" về 2 môn: Độc tố học và an toàn thực phầm + Các phương pháp phân tích hiện đại.\r\nEm kính nhờ BCT đánh giá lại như sau:\r\n1. Môn Độc tố học và ATTP: môn chuyên ngành không có mở lớp nên em ko xây dựng khóa học. Tuy nhiên em quên trình báo để xóa học phần E-learning này ạ!\r\n2. Các PPPT hiện đại: em có cập nhật đầy đủ nội dung, nhưng kết quả báo là không có nội dung. Vui lòng xem lại giúp em!\r\nEm chân thành cảm ơn ạ!\r\n\r\n',1472,2,7835,'1. Đã xóa khóa học \"22122 - 320209 - Độc tố học và an toàn thực phẩm - Nguyễn Xuân Thị Diễm Trinh\". BCT dựa vào đối chiếu danh sách \"Học phần hủy do không đủ sinh viên đăng ký\" của phòng đào tạo.\r\n2. BCT đã báo TLC Khóa \"22122 - 320308 - Các phương pháp phân tích hiện đại - DA19HH - Nguyễn Xuân Thị Diễm Trinh\" đánh giá lại.','2022-06-23 09:58:06',1,'2022-06-21 08:07:10','2022-07-02 10:30:34',63),('Vẽ kỹ thuật - DA19HH - Nguyễn Thanh Hiền ','',NULL,'Lớp này không có dạy',1483,2,7830,'BCT đã xử lý, cảm ơn Quý Thầy/Cô đã phản hồi.','2022-06-21 09:15:56',1,'2022-06-21 08:08:51','2022-07-02 10:39:36',64),('Vẽ kỹ thuật - DA19HH - Nguyễn Thanh Hiền ','',NULL,'Lớp này không có dạy',1483,2,7838,'','2022-06-28 10:42:28',1,'2022-06-21 08:08:54','2022-07-02 10:38:52',65),('yêu cầu kiểm tra lại lý do không đạt','',NULL,'Nhờ BCT kiểm tra lại khóa học  22122 - 220070 - Lập trình UD phân tán ĐT - Nhan Minh Phúc , lý do ko đạt là không cập nhật nội dung. \r\nko biết là nội dung nào ko cập nhật? do nôi dung vẫn như những năm qua và được đánh giá đạt những năm vừa qua.\r\nTrân trọng\r\n',7940,2,7830,'Đã cập nhật kết quả thành ĐẠT.','2022-06-21 09:02:05',1,'2022-06-21 08:09:13','2022-07-02 10:38:23',66),('yêu cầu kiểm tra lại lý do không đạt','',NULL,'Nhờ BCT kiểm tra lại khóa học  22122 - 220070 - Lập trình UD phân tán ĐT - Nhan Minh Phúc , lý do ko đạt là không cập nhật nội dung. \r\nko biết là nội dung nào ko cập nhật? do nôi dung vẫn như những năm qua và được đánh giá đạt những năm vừa qua.\r\nTrân trọng\r\n',7940,2,7838,'','2022-06-28 10:42:58',1,'2022-06-21 08:09:15','2022-07-02 10:38:02',67),('Khóa học 22122 - 450237 - Pháp luật về các hành vi thương mại - Huỳnh