ả giảng dạy Kỹ năng Làm việc nhóm.',0,2,'2023-03-02 14:43:32','2023-03-03 08:56:16',87),(57,'Phương pháp giảng dạy Kỹ năng Làm việc nhóm','2023-03-09',20,'','Mục tiêu:\r\nXác định nội dung giảng dạy Kỹ năng Làm việc nhám.\r\nXây dựng và thực hiện bài giảng Kỹ năng Làm việc nhóm.\r\nNâng cao hiệu quả giảng dạy Kỹ năng Làm việc nhóm.',0,3,'2023-03-02 14:51:18','2023-03-03 08:55:45',88),(51,'Phương pháp giảng dạy Kỹ năng Giải quyết vấn đề','2023-03-10',20,'','Mục tiêu:\r\nXác định nội dung giảng dạy Kỹ năng Giải quyết vấn đề.\r\nXây dựng và thực hiện bài giảng Kỹ năng Giải quyết vấn đề.\r\nNâng cao hiệu quả giảng dạy Kỹ năng Giải quyết vấn đề.',0,3,'2023-03-02 15:16:23','2023-03-03 08:56:30',89),(51,'Phương pháp giảng dạy Kỹ năng Giải quyết vấn đề','2023-03-10',20,'','Mục tiêu:\r\nXác định nội dung giảng dạy Kỹ năng Giải quyết vấn đề.\r\nXây dựng và thực hiện bài giảng Kỹ năng Giải quyết vấn đề.\r\nNâng cao hiệu quả giảng dạy Kỹ năng Giải quyết vấn đề.',0,3,'2023-03-02 15:23:27','2023-03-03 08:56:45',90),(58,'Tập huấn các kỹ năng thuyết trình (PSW: Presentation Skills Workshop)','2023-03-22',12,'','Mục tiêu: \r\n1. Xây dựng bài thuyết trình có cấu trúc hoàn chỉnh theo mô hình PROBED \r\n2.  Sử dụng các kỹ thuật trình bày tiên tiến để tạo nên một bài thuyết trình hiệu quả\r\n3. Sử dụng các công cụ trực quan để làm tăng hiệu quả của bài thuyết trình\r\n4. Thực hành thuyết trình trước đám đông với sự tự tin.\r\n5. Nhận và cho những thông tin phản hồi hữu ích về cách trình bày.\r\n Đặc biệt được cấp giấy chứng nhận của mạng lưới ISW Canada (iswnetwork.ca).',0,3,'2023-03-02 15:54:46','2023-03-03 08:56:58',91),(59,'Các phương pháp giảng dạy cho học đảo ngược (Flipped Learning)','2023-03-21',20,'','Lớp tập huấn này sẽ giới thiệu cho các bạn kỹ thuật tích hợp các hoạt động học tập trải nghiệm vào giảng dạy của mình bằng phương pháp dạy học đảo ngược hoặc chuyển các hoạt động giảng dạy lý thuyết sang môi trường trực tuyến và để dành thời gian học sâu hơn trong lớp học trực tiếp. Bạn cần kiểm tra những điều kiện sau đây trước khi tham dự tập huấn: Có tài khoản chatGPT, tài khoản Canva và một khóa học E-Learning trên LMS. Nếu bạn chưa đáp ứng các điều kiện này, hãy liên hệ Ban E-Learning của CELRI (Trung tâm Học liệu - Phát triển Dạy và Học) để được hỗ trợ.\r\nCác kết quả Buổi 1:\r\n1. Xây dựng kế hoạch để tích hợp một loại hình học tập trải nghiệm (ví dụ: vấn đề, tình huống, dự án, thiết kế, tra cứu, v.v.) vào giảng dạy.\r\n2. Sử dụng chatGPT để tạo kịch bản bài giảng, bài đọc, câu hỏi đố vui, nội dung PPT và ý tưởng học tập trải nghiệm.\r\n3. Tạo video hướng dẫn bằng Canva, bao gồm quay video và âm thanh, thêm thành phần, v.v.\r\n4. Thiết kế một bài học đảo ngược hoàn chỉnh trong Moodle, bao gồm xây dựng kịch bản bài giảng, bài đọc, câu hỏi đố vui, nội dung PPT và các hoạt động học tập trải nghiệm.\r\nCác kết quả Buổi 2:\r\n1. Sử dụng ChatGPT để tạo các hoạt động hoặc sản phẩm học tập phù hợp với chuẩn đầu ra học phần.\r\n2. Tạo các hoạt động học tập trải nghiệm bao gồm các quy trình triển khai hoạt động, các đánh giá quá trình & kết thúc và các tài liệu giảng dạy như các bài tập, các tình huống có vấn đề và các nghiên cứu tình huống.\r\n3. Tạo các bài tập đánh giá trên Moodle để đo lường việc học của sinh viên từ các hoạt động học tập trải nghiệm.\r\n\r\n',0,2,'2023-03-02 17:06:25','2023-03-15 08:49:53',92),(59,'Các phương pháp giảng dạy cho học đảo ngược (Flipped Learning)','2023-03-23',20,'','Lớp tập huấn này sẽ giới thiệu cho các bạn kỹ thuật tích hợp các hoạt động học tập trải nghiệm vào giảng dạy của mình bằng phương pháp dạy học đảo ngược hoặc chuyển các hoạt động giảng dạy lý thuyết sang môi trường trực tuyến và để dành thời gian học sâu hơn trong lớp học trực tiếp. Bạn cần kiểm tra những điều kiện sau đây trước khi tham dự tập huấn: Có tài khoản chatGPT, tài khoản Canva và một khóa học E-Learning trên LMS. Nếu bạn chưa đáp ứng các điều kiện này, hãy liên hệ Ban E-Learning của CELRI (Trung tâm Học liệu - Phát triển Dạy và Học) để được hỗ trợ.\r\nCác kết quả Buổi 1:\r\n1. Xây dựng kế hoạch để tích hợp một loại hình học tập trải nghiệm (ví dụ: vấn đề, tình huống, dự án, thiết kế, tra cứu, v.v.) vào giảng dạy.\r\n2. Sử dụng chatGPT để tạo kịch bản bài giảng, bài đọc, câu hỏi đố vui, nội dung PPT và ý tưởng học tập trải nghiệm.\r\n3. Tạo video hướng dẫn bằng Canva, bao gồm quay video và âm thanh, thêm thành phần, v.v.\r\n4. Thiết kế một bài học đảo ngược hoàn chỉnh trong Moodle, bao gồm xây dựng kịch bản bài giảng, bài đọc, câu hỏi đố vui, nội dung PPT và các hoạt động học tập trải nghiệm.\r\nCác kết quả Buổi 2:\r\n1. Sử dụng ChatGPT để tạo các hoạt động hoặc sản phẩm học tập phù hợp với chuẩn đầu ra học phần.\r\n2. Tạo các hoạt động học tập trải nghiệm bao gồm các quy trình triển khai hoạt động, các đánh giá quá trình & kết thúc và các tài liệu giảng dạy như các bài tập, các tình huống có vấn đề và các nghiên cứu tình huống.\r\n3. Tạo các bài tập đánh giá trên Moodle để đo lường việc học của sinh viên từ các hoạt động học tập trải nghiệm.\r\n\r\n',0,3,'2023-03-02 17:12:24','2023-04-12 09:55:04',93),(2,'Kỹ thuật thiết kế câu hỏi đánh giá trên hệ thống LMS (21/03/2023)','2023-03-21',20,'','Mục tiêu: Sau khi tham dự tập huấn, người tham dự có thể:\r\no	Thêm câu hỏi trắc nghiệm vào ngân hàng câu hỏi LMS theo cách thủ công.\r\no	Nhập hàng loạt câu hỏi nhiều lựa chọn vào ngân hàng câu hỏi LMS.\r\no	Tạo bài tập trắc nghiệm trên LMS.\r\no	Xuất điểm bài tập trắc nghiệm về file Excel.\r\n',0,2,'2023-03-15 09:53:19','2023-03-15 09:54:06',97),(2,'Kỹ thuật thiết kế câu hỏi đánh giá trên hệ thống LMS (23/03/2023)','2023-03-23',20,'','Mục tiêu: Sau khi tham dự tập huấn, người tham dự có thể:\r\no	Thêm câu hỏi trắc nghiệm vào ngân hàng câu hỏi LMS theo cách thủ công.\r\no	Nhập hàng loạt câu hỏi nhiều lựa chọn vào ngân hàng câu hỏi LMS.\r\no	Tạo bài tập trắc nghiệm trên LMS.\r\no	Xuất điểm bài tập trắc nghiệm về file Excel.\r\n',0,2,'2023-03-15 10:00:31','2023-03-15 10:00:31',99),(60,'Kỹ năng Quản lý sự thay đổi (Chiều 10/06/2022 và Chiều 17/06/2022)','2022-06-10',25,'','',0,2,'2023-03-16 11:10:38','2023-03-16 11:10:38',100),(58,'Tập huấn các kỹ năng thuyết trình (PSW: Presentation Skills Workshop)','2023-04-18',12,'','Mục tiêu: \r\n1. Xây dựng bài thuyết trình có cấu trúc hoàn chỉnh theo mô hình PROBED \r\n2.  Sử dụng các kỹ thuật trình bày tiên tiến để tạo nên một bài thuyết trình hiệu quả\r\n3. Sử dụng các công cụ trực quan để làm tăng hiệu quả của bài thuyết trình\r\n4. Thực hành thuyết trình trước đám đông với sự tự tin.\r\n5. Nhận và cho những thông tin phản hồi hữu ích về cách trình bày.\r\n Đặc biệt được cấp giấy chứng nhận của mạng lưới ISW Canada (iswnetwork.ca).',0,3,'2023-04-04 16:30:25','2023-04-12 09:37:08',101),(47,'Phương pháp giảng dạy Kỹ năng Thuyết trình ','2023-04-13',20,'','Mục tiêu: Sau khi hoàn thành chuyên đề này, người tham dự sẽ có thể:\r\n1. Xác định nội dung giảng dạy Kỹ năng Thuyết trình.\r\n2. Xây dựng và thực hiện bài giảng Kỹ năng Thuyết trình.\r\n3. Nâng cao hiệu quả giảng dạy Kỹ năng Thuyết trình.\r\n',0,2,'2023-04-04 16:48:49','2023-04-11 17:02:13',102),(61,'Phương pháp giảng dạy Kỹ năng Quản lý thời gian và tổ chức công việc','2023-04-19',20,'','Mục tiêu: Sau khi hoàn thành chuyên đề này, người tham dự sẽ có thể: \r\n1. Xác định nội dung giảng dạy Kỹ năng Quản lý thời gian và tổ chức công việc.\r\n2. Xây dựng và thực hiện bài giảng Kỹ năng Quản lý thời gian và tổ chức công việc.\r\n3. Nâng cao hiệu quả giảng dạy Kỹ năng Quản lý thời gian và tổ chức công việc.',0,2,'2023-04-05 08:14:46','2023-04-11 16:55:21',103),(62,'Thiết kế chương trình học trực tuyến nhanh với ChatGPT và Canva','2023-04-17',15,'','Mô tả: Trong hai buổi học này, người tham dự sẽ học cách tạo nội dung trực tuyến cho các khóa học Moodle của mình một cách nhanh chóng bằng cách sử dụng ChatGPT và Canva. ChatGPT là một bộ xử lý ngôn ngữ tự nhiên trí tuệ nhân tạo hỗ trợ thiết kế chương trình học nếu được sử dụng hiệu quả. Canva là một nền tảng trực tuyến miễn phí giúp tạo nội dung nhanh và chất lượng.\r\nSau khi kết thúc các buổi tập huấn, người tham dự sẽ có thể:\r\n1.	Nhanh chóng tạo ra các kết quả học tập, bài học, giới thiệu bài học, các bài tập trực tuyến, đánh giá trực tuyến và các kịch bản với sự trợ giúp của ChatGPT;\r\n2.	Lập kế hoạch các chiến lược và hoạt động hỗ trợ sinh viên tham gia trực tuyến;\r\n3.	Thêm nội dung và các yếu tố khóa học vào Moodle như nhãn, tập tin, URL, bài tập, diễn đàn, bài kiểm tra, vv.;\r\n4.	Sử dụng Canva để tạo ra các PPT chất lượng cao và các video PPT có giọng nói để truyền tải chương trình học.\r\nNgười tham dự các buổi tập huấn phải có laptop của riêng mình, có thể sử dụng tài khoản TVU ChatGPT chung trong suốt buổi học, và sẽ có cơ hội có được tài khoản cá nhân của riêng mình với một khoản phí nhỏ (khoảng 50.000 VND). Nếu người tham dự chưa có trang web khóa học Moodle thì sẽ được tạo cho một trang web trước khi bắt đầu buổi học.\r\n',0,2,'2023-04-07 07:50:57','2023-04-07 08:23:47',104),(62,'Thiết kế chương trình học trực tuyến nhanh với ChatGPT và Canva','2023-04-19',15,'','Mô tả: Trong hai buổi học này, người tham dự sẽ học cách tạo nội dung trực tuyến cho các khóa học Moodle của mình một cách nhanh chóng bằng cách sử dụng ChatGPT và Canva. ChatGPT là một bộ xử lý ngôn ngữ tự nhiên trí tuệ nhân tạo hỗ trợ thiết kế chương trình học nếu được sử dụng hiệu quả. Canva là một nền tảng trực tuyến miễn phí giúp tạo nội dung nhanh và chất lượng.\r\nSau khi kết thúc các buổi tập huấn, người tham dự sẽ có thể:\r\n1.	Nhanh chóng tạo ra các kết quả học tập, bài học, giới thiệu bài học, các bài tập trực tuyến, đánh giá trực tuyến và các kịch bản với sự trợ giúp của ChatGPT;\r\n2.	Lập kế hoạch các chiến lược và hoạt động hỗ trợ sinh viên tham gia trực tuyến;\r\n3.	Thêm nội dung và các yếu tố khóa học vào Moodle như nhãn, tập tin, URL, bài tập, diễn đàn, bài kiểm tra, vv.;\r\n4.	Sử dụng Canva để tạo ra các PPT chất lượng cao và 